import { Cog, Code } from "lucide-react";


const OOPs = () => {
  const topics = [
    { name: "Classes & Objects", desc: "Understand class, object, and methods.", icon: <Cog className="w-10 h-10 text-yellow-600"/>, path: "/placement-prep/core-subjects/oops/classes", color: "from-yellow-100 to-yellow-50" },
    { name: "Inheritance & Polymorphism", desc: "Learn different types of inheritance and method overriding.", icon: <Code className="w-10 h-10 text-blue-600"/>, path: "/placement-prep/core-subjects/oops/inheritance", color: "from-blue-100 to-blue-50" },
  ];

  return (
    <SubjectPage
      title="OOPs Preparation"
      description="Master object-oriented programming: abstraction, encapsulation, and polymorphism."
      topics={topics}
    />
  );
};

export default OOPs;
